import * as React from 'react';
import {
  Button,
  View,
  Text,
  SafeAreaView,
  StyleSheet,
} from 'react-native';
import { Box, Flex, HStack, Stack, Center, NativeBaseProvider, Container, Heading } from "native-base"

const FirstPage = ({ navigation }) => {
  return (
    <SafeAreaView>
    <Center>
      <Flex direction="row">
      <Box>
        <Flex direction="column" style={styles.firstColumn}>
          <Center
            size={40}
            width="100%"
            bg="primary.200"
            _text={{
              color: "white",
            }}
          >
            200
          </Center>
          <Center
            bg="primary.300"
            size={40}
            width="100%"
            _text={{
              color: "white",
            }}
          >
            300
          </Center>
          <Center
            size={40}
            width="100%"
            bg="primary.400"
            _text={{
              color: "white",
            }}
          >
            400
          </Center>
        </Flex>
      </Box>
            <Box>
        <Flex direction="column" style={styles.secondColumn}>
          <Center
            bg="primary.300"
            size={80}
            width="100%"
            _text={{
              color: "white",
            }}
          >
            300
          </Center>
          <Center
            size={40}
            width="100%"
            bg="primary.400"
            _text={{
              color: "white",
            }}
          >
            400
          </Center>
        </Flex>
      </Box>
      </Flex>
        <Box style={styles.next}>
          <Center
            size={500}
            bg="primary.300"
            _text={{
              color: "white",
            }}
          >
            Who's Next?
          </Center>
      </Box>
    </Center>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  next: {
    marginTop: "4em",
  },
  bigBlue: {
    color: 'blue',
    fontWeight: 'bold',
    fontSize: 30,
  },
  firstColumn: {
    width: "26em",
  },
  secondColumn: {
    marginLeft: "2em",
    width: "26em",
  },
});

export default FirstPage;
